import React, {useEffect} from 'react'
import {ServicesCards} from "../components/servicesCards";
import {useDispatch} from "react-redux";
import {useData} from "../store_redux/slices/services";
export function ServicesPage(){
    useEffect(() => {
        fetch('api/',{method : "GET"})
            .then((res) => res.json())
            .then((data) => {
                dispatch(SetCursesAction(JSON.parse(data)))
                }
            );
    }, [])
    const dispatch = useDispatch()
    const data = useData()
    return(
        <div >
            <ul className='main-card-services'>
                <p className="text-main">Доступные услуги</p>
                { data.map((data) => <ServicesCards Props={data} key={data.id} />) }
            </ul>
        </div>
    )
}
